import React from "react";
import { Card } from "semantic-ui-react";

const styles = {
  card: {
    background: "#000",
    color: "#000"
  }
};
export default function CarData(props) {
  const { cars } = props;
  return cars.map((car, id) => {
    if (car.active) {
      return (
        <Card fluid key={id} color="grey">
          <Card.Content>
            <Card.Header>{car.plate}</Card.Header>
            <Card.Description>
              <h5>Address</h5>
              <p>{car.address}</p>
            </Card.Description>
          </Card.Content>
        </Card>
      );
    }
  });
}
